import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter as Router , Route} from 'react-router-dom';

import Navabr from './components/navbar.component'
import ExercisesList from './components/exercises-list.component'
import CreateExercises from './components/create-user.component'
import CreateUser from './components/create-user.component'
import EditExercises from './components/edit-exercises.component'
export default class App extends Component {
  render() {
    return (
<div>
  <Router>
      <Navabr>
          <br/>
          <Route path to ="/"  component ={ExercisesList} />
          <Route path t ="/edit/:id" exact component ={EditExercises} />
          <Route path ="/create" exact component ={CreateExercises} />
          <Route path ="/user" exact component ={CreateUser} />
      </Navabr>
  </Router>  
</div>
    )
  }
}
